using Harmony;
using System;
using System.Collections;
using System.Collections.Generic;
using UnityEngine;

[ModTitle("Bigger Plots")] // The mod name.
[ModDescription("Adds some nice crop plots")] // Short description for the mod.
[ModAuthor("TeigRolle")] // The author name of the mod.
[ModIconUrl("https://i.imgur.com/OppQ995.png")] // An icon for your mod. Its recommended to be 128x128px and in .jpg format.
[ModWallpaperUrl("https://i.imgur.com/Bo93aNH.jpg")] // A banner for your mod. Its recommended to be 330x100px and in .jpg format.
[ModVersionCheckUrl("https://raftmodding.com/api/v1/mods/biggerplots/version.txt")] // This is for update checking. Needs to be a .txt file with the latest mod version.
[ModVersion("1.1.5")] // This is the mod version.
[RaftVersion("Update Name")] // This is the recommended raft version.
[ModIsPermanent(true)] // If your mod add new blocks, new items or just content you should set that to true. It loads the mod on start and prevents unloading.

public class BiggerPlots : Mod
{
    public static AssetBundle assetbundle;

    

    void Start()
    {


        RNotification notification = FindObjectOfType<RNotify>().AddNotification(RNotify.NotificationType.spinning, "Loading BiggerPlots...");

        assetbundle = AssetBundle.LoadFromMemory(Convert.FromBase64String(BiggerPlotsAssets.encodedAssetBundle));

        /*
        assetbundle = bundleLoadRequest.assetBundle;
        if (assetbundle == null)
        {
            RConsole.LogError("Failed to load AssetBundle for BiggerPlots!");
            notification.Close();
            yield return null;
        }
        */

        List<Item_Base> list = Traverse.Create(typeof(ItemManager)).Field("allAvailableItems").GetValue<List<Item_Base>>();

        Item_Base placeable_biggerplots_1x1 = (Item_Base)assetbundle.LoadAsset<ScriptableObject>("placeable_biggerplots_1x1");
        placeable_biggerplots_1x1.Initialize(1167, "placeable_biggerplots_1x1", 1);


        Item_Base placeable_biggerplots_2x2 = (Item_Base)assetbundle.LoadAsset<ScriptableObject>("placeable_biggerplots_2x2");
        placeable_biggerplots_2x2.Initialize(1168, "placeable_biggerplots_2x2", 1);


        Item_Base placeable_biggerplots_3x3 = (Item_Base)assetbundle.LoadAsset<ScriptableObject>("placeable_biggerplots_3x3");
        placeable_biggerplots_3x3.Initialize(1169, "placeable_biggerplots_3x3", 1);


        Item_Base placeable_biggerplots_4x4 = (Item_Base)assetbundle.LoadAsset<ScriptableObject>("placeable_biggerplots_4x4");
        placeable_biggerplots_4x4.Initialize(1170, "placeable_biggerplots_4x4", 1);
        

        Item_Base placeable_biggerplots_5x5 = (Item_Base)assetbundle.LoadAsset<ScriptableObject>("placeable_biggerplots_5x5");
        placeable_biggerplots_5x5.Initialize(1171, "placeable_biggerplots_5x5", 1);
        

        Item_Base placeable_biggerplots_6x6 = (Item_Base)assetbundle.LoadAsset<ScriptableObject>("placeable_biggerplots_6x6");
        placeable_biggerplots_6x6.Initialize(1172, "placeable_biggerplots_6x6", 1);
        

        Item_Base placeable_biggerplots_7x7 = (Item_Base)assetbundle.LoadAsset<ScriptableObject>("placeable_biggerplots_7x7");
        placeable_biggerplots_7x7.Initialize(1173, "placeable_biggerplots_7x7", 1);
        

        Item_Base placeable_biggerplots_8x8 = (Item_Base)assetbundle.LoadAsset<ScriptableObject>("placeable_biggerplots_8x8");
        placeable_biggerplots_8x8.Initialize(1174, "placeable_biggerplots_8x8", 1);

        list.Add(placeable_biggerplots_1x1);
        list.Add(placeable_biggerplots_2x2);
        list.Add(placeable_biggerplots_3x3);
        list.Add(placeable_biggerplots_4x4);
        list.Add(placeable_biggerplots_5x5);
        list.Add(placeable_biggerplots_6x6);
        list.Add(placeable_biggerplots_7x7);
        list.Add(placeable_biggerplots_8x8);

        FixMaterial(placeable_biggerplots_1x1);
        FixMaterial(placeable_biggerplots_2x2);
        FixMaterial(placeable_biggerplots_3x3);
        FixMaterial(placeable_biggerplots_4x4);
        FixMaterial(placeable_biggerplots_5x5);
        FixMaterial(placeable_biggerplots_6x6);
        FixMaterial(placeable_biggerplots_7x7);
        FixMaterial(placeable_biggerplots_8x8);

        notification.Close();

    }

    void FixMaterial(Item_Base newItem)
    {
		newItem.settings_buildable.GetBlockPrefab(0).gameObject.layer = 10;
        newItem.settings_buildable.GetBlockPrefab(0).GetComponent<Cropplot>().acceptableItemTypes = ItemManager.GetItemByName("Placeable_Cropplot_Medium").settings_buildable.GetBlockPrefab(0).GetComponent<Cropplot>().acceptableItemTypes;
        newItem.settings_buildable.GetBlockPrefab(0).GetComponent<Cropplot>().acceptableItemTypes.Add(ItemManager.GetItemByName("Seed_Palm"));
        newItem.settings_buildable.GetBlockPrefab(0).GetComponent<Cropplot>().acceptableItemTypes.Add(ItemManager.GetItemByName("Seed_Mango"));
		newItem.settings_buildable.GetBlockPrefab(0).GetComponent<Cropplot>().acceptableItemTypes.Add(ItemManager.GetItemByName("Seed_Pine"));
		newItem.settings_buildable.GetBlockPrefab(0).GetComponent<Cropplot>().acceptableItemTypes.Add(ItemManager.GetItemByName("Seed_Birch"));

        Cropplot plot = newItem.settings_buildable.GetBlockPrefab(0).GetComponent<Cropplot>();

        Material plotMat = ItemManager.GetItemByName("Placeable_Cropplot_Small").settings_buildable.GetBlockPrefab(0).GetComponentInChildren<Renderer>().material;
        Material dirtMat = ItemManager.GetItemByName("Placeable_Cropplot_Small").settings_buildable.GetBlockPrefab(0).GetComponentsInChildren<Renderer>()[1].material;

        foreach (Renderer rnd in newItem.settings_buildable.GetBlockPrefab(0).GetComponentsInChildren<Renderer>())
        {
            rnd.material = dirtMat;
        }


        newItem.settings_buildable.GetBlockPrefab(0).GetComponentsInChildren<Renderer>()[0].material = plotMat;

        RAPI.AddItemToBlockQuadType(newItem, RBlockQuadType.quad_floor);
        RAPI.AddItemToBlockQuadType(newItem, RBlockQuadType.quad_foundation);
    }

    // The Update() method is being called every frame. Have fun!
    public void Update()
    {

    }

    // The OnModUnload() method is being called when your mod gets unloaded.
    public void OnModUnload()
    {
        RConsole.Log("BiggerPlots can't be unloaded!");
    }
}

public static class BiggerPlotsAssets {
    public static string encodedAssetBundle = "";
}
